import React from 'react';
import '../../App.scss';
import Join from '../Join/Join';

export default function Title() {
  const [title, setTitle] = useState(true)

  const join = () => {
    return (<Join/>)
  }

  return (
    <div className="App">
      <h1>You Don't Know Diddly Squat</h1>
      <h3>A multiplayer quiz show for the whole family!</h3>
      <button onClick={join}>Let's Go!</button>
    </div>
  );
}
